import '../styles/App.css';
import React from "react";
import { BrowserRouter as Router } from "react-router-dom";

import { Switch , Route } from "react-router-dom";

import Register from "./Register"; 
import User_Login from "./User_Login"; 
import Start from "./Start"; 
import Post from "./Post";
import Mainpage from "./Mainpage";
import User_Profile from "./User_Profile";
import Create_quiz from "./Create_quiz";

import AllPost from "./AllPost";

function App() {



  return (
  <>
    <Router>
      <Switch>
          <Route path="/user_login" exact component={User_Login} />
          <Route path="/create_quiz/:id" exact component={Create_quiz} />
          <Route path="/" exact component={Start} />
          <Route path="/User_Profile/:id" exact component={User_Profile} />
          <Route path="/register" exact component={Register} />
          <Route path="/main/:id" exact component={Mainpage} />
          <Route path="/Post/:id" exact component={Post} />
          <Route path="/AllPost/:id" exact component={AllPost} />

      </Switch>
    </Router>


  </>
  );
}
export default App;
